When a JavaScript application grows big, it becomes difficult for the user to manage its state. It can be difficult to pass data from child component to parent component in certain cases. Redux solves this problem by managing application's state with a single global object called Store Makes Testing very easy Consistency throughout the application ACTION An action is a plain JS object that describes the intention to cause change(Like ordering something on a button click) Has a type field like { type : 'ORDER' } Tells what to do but doesnt tell how to do Pure Object example : return { type : "INCREMENT", paylaod: num
} Action creator is a pure function which creates an action. Example : incNumber() is the function which creates action export const incNumber = (num) => { return { type : "INCREMENT", paylaod: num }
} REDUCER A reducer is a function that determines changes to an application's state, return the new state and tell the store how to do. ACTION ---→ REDUCER ---→ STORE ↑ | | | |-------VIEWS ←---------| Reducers are functions that take current state and an action both as arguements and return a new state. Example : Fruit making machine with 3 parts like redux which are : 1. Action(moving the handle), 2. Reducer(machine crushing fruit), 3. State(Juice result) REDUX STORE Redux store brings together state, actions and reducers of the app Only a single centralised store is there for the app It is basically a reducer only with root reducer REDUX PRINCIPLES Single store is the single source of truth State is read-only and to change it there needs to be a dispatch of an action Immutability in data (data is consistent and not changing), one way data flow and predictibilty of the outcome Changes are made with 'Pure Reducer Function' means if same argument is passed then same outcome will come. -- UI Views - Kid Action creators - Parents - will send 2 things: Type & Payload. (parents dispatching msg via Whatsapp to mad boy for kid's demands) Reducer - Can be a real world entity like Mad boy (Mad boy fulfills demands of kid from redux store)
